Sunday #weddingpainting at @thelarkfield, wedding 3 of this busy #junewedding #weddingweekend! Did you guys know I'm often one of the last people to leave a venue--because even when I take a painting to my studio for further touchups, I always try to get it to a place I'm happy with while I'm still at the venue/able to see the room in person, and "in the zone!" Scroll to see a few subtle changes I made to this "just the two of us" #liveeventpainting after this photo was taken with the couple and they had left. Might make a few subtle tweaks in the studio as well, but I think this is pretty close! So many great details to capture and I'm loving being able to really focus on the background/decor and the moment between the couple, as more of you request these paintings without other guests. Also I love a couple that's not afraid of a little color in their #centerpieces and their painting!

